v8:item.v8:content:
Уменьшения налогооблагаемой валовой выручки, предусмотренные в строках:
1) 0201-0207, отражаются в Расчете единого налогового платежа в графе "основной вид деятельности";
2) 0208, 0209, 0210, 0211, 0212, отражаются в Расчете единого налогового платежа в графе соответствующего вида деятельности;
3) 030, отражаются в Расчете единого налогового платежа в графе соответствующего вида деятельности;
4) 040 и 050, отражаются в Расчете единого налогового платежа в графе каждого вида деятельности исходя из его удельного веса в соответствии со строкой 020 Расчета единого налогового платежа.
